from pydantic import BaseModel
from typing import List
from model.animal import Animal

class AnimalSchema(BaseModel):
    """ Define como um animal deve ser representado
    """
    id: int = 1
    nome: str = "cachorro"
    vida: str = 12
    velocidade: str = 30
    tamanho: str = 0.6
    peso: str = 30
    imagem: str = 'data:image/png;base64,'


class AnimalBuscaSchema(BaseModel):
    """ Define como deve ser a estrutura que representa a busca. Que será
        feita apenas com base no nome do animal.
    """
    nome: str = "cachorro"


class ListagemAnimaisSchema(BaseModel):
    """ Define como uma listagem de animais será retornada.
    """
    animais:List[AnimalSchema]


def apresenta_animais(animais: List[Animal]):
    """ Retorna uma representação do animal seguindo o schema definido em
        AnimalViewSchema.
    """
    result = []
    for animal in animais:
        result.append({
            "id": animal.id,
            "nome": animal.nome,
            "vida": animal.vida,
            "velocidade": animal.velocidade,
            "tamanho": animal.tamanho,
            "peso": animal.peso,
            "imagem": animal.imagem
        })

    return {"animais": result}


class AnimalViewSchema(BaseModel):
    """ Define como um animal será retornado: animal.
    """
    id: int = 1
    nome: str = "cachorro"
    vida: str = 12
    velocidade: str = 30
    tamanho: str = 0.6
    peso: str = 30
    imagem: str = 'data:image/png;base64,'


def apresenta_animal(animal: Animal):
    """ Retorna uma representação do animal seguindo o schema definido em
        AnimalViewSchema.
    """
    return {
        "id": animal.id,
        "nome": animal.nome,
        "vida": animal.vida,
        "velocidade": animal.velocidade,
        "tamanho": animal.tamanho,
        "peso": animal.peso,
        "imagem": animal.imagem
    }
